{'summary': 'An open label, safety and pharmacokinetic study of oral hydroxyurea solution administered to children from 6 months to 17.99 years (i.e. to the day before 18th birthday), with a 12 to 15 month treatment period for each participant. The study treatment duration will be for 6 months at the maximum tolerated dose \[MTD\], which is usually reached by 6 months after initiation of treatment. For patients in whom time to MTD is longer than 6 months or not achieved at all, the maximum duration of study treatment will be 15 months.', 'secondary_outcomes': "Adverse Events, Incidence of Adverse events during the course of the trial from screening to final follow up phone call at Week 64.

Relatedness refers to 'at least possibly related to the IMP', with severity/toxicity assessed using the CTCAE Toxicity Grade and seriousness based on the standard definition for SAE in accordance with GCP. With the exception of SCA related events, requiring \>7day hospitalisation, or extension of hospitalisation before being reported as an SAE due to their frequency within the disease population. All other non-SCA related SAEs were reportable., Screening Up to Week 64|Absolute Neutrophil Count (ANC), Safety review for haematological toxicity (mild myelosuppression target: 1-3x10\^9/L), Baseline and Week 60 (or final visit); max 15 months on treatment|White Blood Cell Count (Leukocytes), Impact of Hydroxyurea on Safety, Hematology and Biochemistry, Baseline to Week 60 or Final Visit; max 15 months on treatment|Platelets, Impact of Hydroxyurea on Safety, Hematology and Biochemistry, Baseline to Week 60 (or Final Visit), max 15 months on treatment|Mean Corpuscular Hemoglobin (MCH), Impact of Hydroxyurea on Safety, Hematology and Biochemistry, Baseline to Week 60 (or Final Visit), max 15 months on treatment|Hematocrit, Impact of Hydroxyurea on Safety, Hematology and Biochemistry, Up to Week 60|Bilirubin, Impact of Hydroxyurea on Safety, Hematology and Biochemistry, Up to Week 60|Elevation in Liver Function Tests (LFTs), Impact of Hydroxyurea on Safety, Hematology and Biochemistry, including Liver Function Tests (LFTs): Alkaline Phosphatase (ALP), Gamma Glutamyl Transferase (GGT), Aspartate Amino Transferase (AST), Alanine Aminotransferase (ALT), Up to Week 60|Hemoglobin, Safety and efficacy of hydroxyurea therapy, Baseline to Week 60 (or Final Visit); max 15 months on treatment|Bacterial Infections, Impact of Hydroxyurea on Safety, Hematology and Biochemistry, Up to Week 60|Viral Infections, Impact of Hydroxyurea on Safety, Hematology and Biochemistry, Up to Week 60|Fungal Infections, Impact of Hydroxyurea on Safety, Hematology and Biochemistry, Up to Week 60|Leg Ulcers, Impact of Hydroxyurea on Safety, Hematology and Biochemistry, Up to Week 60|Fetal Hemoglobin, Biomarker endpoints of Hydroxyurea efficacy, Baseline to Week 60 (or Final Visit); max 15 months on treatment|Mean Corpuscular Volume (MCV), Biomarker endpoints of Hydroxyurea efficacy, Baseline to Week 60 (or Final Visit); max 15 months on treatment|Cystatin C, Biomarker Endpoints, PK1 (day 1), week 20-32 (6 months) and Week 60 (Final Visit)|Incidence of Acute Vaso-Occlusive Pain Crises (VOC), Hospitalization Incidence for 12 Months Prior to and After First Dose of IMP (Safety Population) for vaso-occlusive crisis (Mean \[SD\]), 12 months prior to treatment and time-averaged 12 months post-treatment; maximum 15 months on IMP|Number and Frequency of Blood Transfusions, Clinical status endpoints, related to blood transfusions for treatment of SCA, this may be hospitalization, A\&E, or in-clinic treatment from safety population (n=32), Up to Week 60|Acute Chest Syndrome (ACS), Hospitalization Incidence for 12 Months Prior to and After First Dose of IMP (Safety Population) for Acute Chest Syndrome (Mean \[SD\]), 12 months prior to treatment and time averaged 12 months post-treatment; maximum 15 months on IMP|Hospitalizations, Clinical Status endpoints, all hospitalisations (not ER/Accident without hospitalization) (Mean \[SD\]), 12 months prior to treatment and time-averaged 12 months post-treatment; maximum 15 months on IMP|Dose Escalation i.e. Maximum Tolerated Dose (MTD), Summary of maximum tolerated dose achieved in mg/kg (Mean \[SD\]), Screening Up to Final Visit (Week 60 or Withdrawal), maximum 15 months on IMP|Other SCA-related Hospitalizations, Clinical parameters (symptoms), secondary clinical status endpoints (not including ACS, VOC, Other Non-SCA related) (mean \[SD\]), 12 months prior to treatment and time averaged 12 months post-treatment; maximum 15 months on IMP|Parent/Caregiver Palatability and Acceptability Questionnaire, Clinical status endpoints. Visual Analogue scale used to determine, taste, smell, aftertaste, acceptability and ease of dosing (1-100mm scale) with 1 being worst possible and 100 being best possible.

Assessed for \<6 years of age by parents/guardians. Assessed for \>6 years of age, combination of parent/guardian and participant responses., Taken once at any point after 8 weeks on study medication (or at early Withdrawal)|Vitamin D, Biochemistry, From Screening Up to Final Visit (Week 60 or WD)|Other Non-SCA-related Hospitalizations, Clinical parameters (symptoms), secondary clinical status endpoints (not including ACS, VOC, Other SCA-related), 12 months prior to treatment and 12 months post-treatment; maximum 15 months on IMP", 'sex': 'ALL', 'nct_id': 'NCT03763656', 'age': 'CHILD', 'primary_outcomes': 'Clearance (CL/F), Model estimated Pharmacokinetic Parameter (PK population: n=32, having received at least one dose of study drug)., 0, 0.25, 0.5, 1, 1.5, 2, 3, 4, 5, 6, and 12 hours post-dose on Day 1 and Day 2 (Week 20-36)|Volume of Distribution (V/F), Model estimated Pharmacokinetic Parameter (PK population: n=32, having received at least one dose of study drug)., 0, 0.25, 0.5, 1, 1.5, 2, 3, 4, 5, 6, and 12 hours post-dose on Day 1 and Day 2 (Week 20-36)|Time to Maximum Concentration (Tmax), Mean Tmax (h) pharmacokinetic parameter derived using the final population PK model., 0, 0.25, 0.5, 1, 1.5, 2, 3, 4, 5, 6, and 12 hours post-dose on Day 1 and Day 2 (Week 20-36)|Maximum Plasma Concentration Cmax (ug/mL), Mean Cmax (ug/mL) pharmacokinetic parameter derived using the final population PK model., 0, 0.25, 0.5, 1, 1.5, 2, 3, 4, 5, 6, and 12 hours post-dose on Day 1 and Day 2 (Week 20-36)|Area Under Plasma Concentration Time Curve (AUC 0-Inf), Mean AUC 0-Infinity (hr\*ug/mL) pharmacokinetic parameters derived using the final population PK model., 0, 0.25, 0.5, 1, 1.5, 2, 3, 4, 5, 6, and 12 hours post-dose on Day 1 and Day 2 (Week 20-36)|Terminal Half-life (Hours), Mean Terminal Half-life (hours) pharmacokinetic parameter derived using the final population PK model., 0, 0.25, 0.5, 1, 1.5, 2, 3, 4, 5, 6, and 12 hours post-dose on Day 1 and Day 2 (Week 20-36)'}

{'summary': 'This clinical trial will inform of the role of Low dose ketamine in the acute treatment of severe painful sickle cell crisis in children in a day-case sickle cell centre. The primary aim is to determine whether Low dose ketamine is non inferior to morphine in the management of acute painful sickle cell crises. The specific objectives will be to determine the maximal change in NRS pain score following administration of ketamine and to examine the safety profile of ketamine compared to morphine in this population.

The investigators hypothesize that low dose ketamine will result in similar effective pain control as morphine alone and will not be associated with an increase in adverse events.', 'secondary_outcomes': "Time to Maximal Analgesic Effect and Duration of Action of Ketamine, Following dosage with study medication, the amount of time taken to demonstrate the maximal change in the patient's NRS pain score.

Maximal change in NRS pain score is to be defined as the largest change from patient's baseline pain score. Duration of maximal change is how long the patient's pain score remained at this level., 5, 10, 20, 40, 60, 80, 100, 120 minutes post drug administration|Incidence of Side Effects, Including Outlying Vital Signs, The patient will be assessed for vital signs (blood pressure, heart rate, respiratory rate, oxygen saturation), Ramsay Sedation Scale (RSS) score at 5,10,20 minutes following medication administration and then every 20 minutes until a total of 120 minutes from the first dose of study medication. outlying vital signs recorded.( systolic Blood pressure less than 90mmHg or greater than 150mmHg, Heart rate less than 50bpm or greater than 150bpm, oxygen saturation below 90%, respiratory rate below 9breaths/minute or greater than 40breaths/minute and RSS of 1 or greater than 3) The RSS was used to asses the level of agitation or sedation caused by the intervention .the scale ranges from 1(anxious/agitated) to 6( no response to stimulus-deep sedation) with 2 being the optimal (cooperative, oriented and tranquil).A checklist for side effects like airway problems, allergic reactions, salivation, dysphoria,nystagmus, respiratory/cardiac arrest, awakening hallucinations, nausea/vomiting was used, 5, 10, 20, 40, 60, 80, 100, 120 minutes post drug administration|Incidence of Treatment Failure by Treatment Group., Requiring more than two doses of the study medication provided for adequate pain control, 120 minutes", 'sex': 'ALL', 'nct_id': 'NCT02434939', 'age': 'CHILD, ADULT', 'primary_outcomes': "Maximal Change in NRS Pain Scores as a Percentage of Baseline NRS Pain Score., Our primary outcome measurement was the maximum change on the verbal NRS pain scale compared with their initial score (baseline). The NRS was used to measure a patient's subjective level of pain on a scale from 0 (representing no pain at all) to 10 (the worst pain imaginable) using whole numbers. The NRS score was documented just prior to the administration of the study drug (time zero). After infusion of the study drug was complete, NRS scores were documented at 5, 10, 20, and then every 20 minutes thereafter up to 120 minutes. We stopped recording NRS scores prior to 120 minutes if the patient requested a third dose of the study drug, withdrew consent or developed a severe adverse effect., 5, 10, 20,25,30, 40,45,50 60, 80, 100, 120 minutes post drug adminstration"}

{'summary': 'This purpose of this study is to understand the differences between people who have a good response to deferasirox (exjade) compared to people who have a poor response to this medication when used for transfusion-dependent iron overload.

The hypothesis is that patients with poor responses have physiologic barriers to deferasirox that may include absorption, pharmacokinetics of drug metabolism, hepatic clearance and/or genetic factors.', 'secondary_outcomes': 'Number of Participants With Polymorphisms in Genes Known to be, or Potentially Involved, in Deferasirox Disposition, Polymorphisms in genes known to be, or potentially involved, in deferasirox disposition: UGT1a1 (including the Gilbert syndrome promoter polymorphism, (TA)nTAA),UGT1a3, BRCP/ABCG2, MRP2/ABCC2. These genes were chosen because deferasirox is primarily eliminated by glucuronidation and subsequent biliary excretion., 3 months', 'sex': 'ALL', 'nct_id': 'NCT00749515', 'age': 'CHILD, ADULT, OLDER_ADULT', 'primary_outcomes': 'Area Under the Curve of Deferasirox After a Dose of 35 mg/kg, Area Under the Curve (AUC) 0 to 24 hours post dose, 0, 1, 2, 4, 6, 8, 12, and 24 hours post dose|Half-Life of Deferasirox, All patients received the same interventions of deferoxamine challenge, deferasirox dose with pharmacokinetic monitoring. Then we compared responses between patients who were known to be slow responders to deferasirox and those who were known to be rapid responders (chelated well).

Deferoxamine: After a 3-day washout period from all chelation, all patients have a 12 hour infusion of 50mg/kg of deferoxamine with urine collection and pre and post blood sampling to assess iron and Total Iron Binding Capacity (TIBC) by atomic absorption., 0, 1, 2, 4, 6, 8, 12, and 24 hours post dose.|Volume of Distribution/Bioavailability of Deferasirox After a Dose of 35 mg/kg, Volume of distribution/bioavailability (Vd/F), 0, 1, 2, 4, 6, 8, 12, and 24 hours post dose|Volume of Distribution/Bioavailability of Deferasirox After a Dose of 35 mg/kg, Volume of distribution/bioavailability (Vd/F), adjusted per kilogram body weight, 0, 1, 2, 4, 6, 8, 12, and 24 hours post dose|Clearance/Bioavailability of Deferasirox in Patients With Poor Response to Deferasirox Compared to Patients With Good Response After a Dose of 35 mg/kg, Clearance/bioavailability (CL/F), 0, 1, 2, 4, 6, 8, 12, and 24 hours post dose.'}
